// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract Warranty {
    struct WarrantyInfo {
        string productName;
        uint256 purchaseDate;
        uint256 warrantyPeriod; // in months
        bool isActive;
    }

    mapping(address => WarrantyInfo) public warranties;

    event WarrantyCreated(address indexed owner, string productName, uint256 purchaseDate, uint256 warrantyPeriod);
    event WarrantyClaimed(address indexed owner);

    function createWarranty(string memory productName, uint256 warrantyPeriod) public {
        require(warranties[msg.sender].isActive == false, "Warranty already exists.");
        
        warranties[msg.sender] = WarrantyInfo({
            productName: productName,
            purchaseDate: block.timestamp,
            warrantyPeriod: warrantyPeriod,
            isActive: true
        });

        emit WarrantyCreated(msg.sender, productName, block.timestamp, warrantyPeriod);
    }

    function claimWarranty() public {
        require(warranties[msg.sender].isActive == true, "No active warranty.");
        require(block.timestamp < warranties[msg.sender].purchaseDate + (warranties[msg.sender].warrantyPeriod * 30 days), "Warranty period expired.");

        // Here, implement the claim logic (e.g., sending notifications, processing claims, etc.)

        warranties[msg.sender].isActive = false; // Mark warranty as claimed
        emit WarrantyClaimed(msg.sender);
    }

    function getWarrantyInfo() public view returns (WarrantyInfo memory) {
        return warranties[msg.sender];
    }
}

